t-2by3" href="/d/24360/" data-original="http://pic.youku778.com/upload/vod/2019-04-10/201904101554900090.png" style="background-image: url(http://pic.youku778.com/upload/vod/2019-04-10/201904101554900090.png);"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">9.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">25</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/24360/">致我们暖暖的小时光</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E9%82%A2%E8%8F%B2------------/" target="_blank">邢菲</a>&nbsp;<a href="/s/-%E6%9E%97%E4%B8%80------------/" target="_blank">林一</a>&nbsp;<a href="/s/-%E5%94%90%E6%99%93%E5%A4%A9------------/" target="_blank">唐晓天</a>&nbsp;<a href="/s/-%E9%83%91%E8%8B%B1%E8%BE%B0------------/" target="_blank">郑英辰</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E7%A5%9D%E4%B8%9C%E5%AE%81--------/" target="_blank">祝东宁</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/13/" target="_blank">国产剧</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2019/" target="_blank">2019</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>司徒末（邢菲 饰）毕业在即，从小便习惯服从安排的她对前途迷茫懵懂，随波逐流地尝试各种安排，总是鼓不起勇气为自己做出选择因新老校区并校，物理系的高材生顾未易（林一 饰）闯入司徒末的生活，平淡无奇的生活掀起了啼笑皆非的浪花。几次三番的交战让司徒末和顾未易这对欢喜冤家逐渐走进对方的心底，更是误打误撞地成为</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/24360/">查看详情</a></dd></dl></div><div class="fed-hide-xs fed-col-sm4 fed-col-md3"><div class="fed-side-code fed-text-right fed-padding"><p class="fed-side-text fed-text-muted fed-padding">扫描二维码手机看大片</p><img class="fed-side-image" width="180" height="180" src="https://ysjtzy.oss-cn-beijing.aliyuncs.com/ewm.png" alt="当前网页二维码" /></div></div><p class="fed-padding fed-part-both fed-text-muted">司徒末（邢菲 饰）毕业在即，从小便习惯服从安排的她对前途迷茫懵懂，随波逐流地尝试各种安排，总是鼓不起勇气为自己做出选择因新老校区并校，物理系的高材生顾未易（林一 饰）闯入司徒末的生活，平淡无奇的生活掀起了啼笑皆非的浪花。几次三番的交战让司徒末和顾未易这对欢喜冤家逐渐走进对方的心底，更是误打误撞地成为合租盟友。在相处过程中，两人逐渐放下偏见，在对方的鼓励和帮助下，找到人生和事业上的新方向，也收获爱情。两人共同经历了毕业、求职、工作，才明白，原来最温暖的小时光，就是走对的路、与对的人做对的事。本片根据赵乾乾同名小说改编。</p></div><div class="fed-tabs-item fed-hidden"><div class="fed-comm-info" data-id="24360" data-mid="1"></div></div></div></div><div class="fed-part-layout fed-back-whits"><div class="fed-list-head fed-part-rows fed-padding"><h2 class="fed-font-xvi">相关热播</h2><ul class="fed-part-tips fed-padding"><li><a class="fed-more" href="/vodtype/13/">更多</a></li></ul></div><ul class="fed-list-info fed-part-rows"><li class="fed-list-item fed-padding fed-col-xs4 fed-col-sm3 fed-col-md2"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/34055/" data-original="http://pic.youku778.com/upload/vod/2019-01-17/15476643368.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">8.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">12</span></a><a class="fed-list-title fed-font-xiv fed-text-center fed-text-sm-left fed-visible fed-part-eone" href="/d/34055/" >追光第一季</a><span class="fed-list-desc fed-font-xii fed-visible fed-part-eone fed-text-muted fed-hide-xs fed-show-sm-block">李潇,Emily,Thomas,王鹏光,常笑然</span></li><li class="fed-list-item fed-padding fed-col-xs4 fed-col-sm3 fed-